import React from 'react'
import { Icon, Menu, MenuItem, Search } from 'semantic-ui-react'

const Topbar = () => {
    return (
        <div className='navbars'>
            <div className='topbar'>
                <Menu stackable>
                    <MenuItem>
                        <img alt='logo' src='https://react.semantic-ui.com/logo.png' />
                    </MenuItem>

                    <MenuItem
                        name='features'
                    //   active={activeItem === 'features'}
                    // onClick={this.handleItemClick}
                    >
                        Features
                    </MenuItem>

                    <MenuItem
                        name='testimonials'
                    //   active={activeItem === 'testimonials'}
                    // onClick={this.handleItemClick}
                    >
                        Testimonials
                    </MenuItem>

                    <MenuItem
                        name='sign-in'
                    //   active={activeItem === 'sign-in'}
                    // onClick={this.handleItemClick}
                    >
                        Sign-in
                    </MenuItem>
                </Menu>
            </div>
            <div className='sidebar'>
            <Menu stackable>
                    <MenuItem>
                        <img alt='logo' src='https://react.semantic-ui.com/logo.png' />
                    </MenuItem>

                    <MenuItem
                        name='features'
                    //   active={activeItem === 'features'}
                    // onClick={this.handleItemClick}
                    >
                        Features
                    </MenuItem>

                    <MenuItem
                        name='testimonials'
                    //   active={activeItem === 'testimonials'}
                    // onClick={this.handleItemClick}
                    >
                        Testimonials
                    </MenuItem>

                    <MenuItem
                        name='sign-in'
                    //   active={activeItem === 'sign-in'}
                    // onClick={this.handleItemClick}
                    >
                        Sign-in
                    </MenuItem>
                </Menu>
            </div>
        </div>
    )
}

export default Topbar
